فکر کن طرف انقدر بیکار و بی عرضه وُ کودن تشریف داره که عین خاله زنکا و مفت خورا یه جا نشسته پهنای تلسکوپ و کرده تو ماتحت این وُ اون و تناقض پیدا کرده. چقدر یه آدم میتونه طفیل و فضول باشه آخه؟
پیدا کردن این نخاله فقط از دست یه سیَه لِنگِ دهن چلاق مثل سعید حجاریان بر میاد.
